import './Nav.css';
import Navbar from 'react-bootstrap/Navbar';
import 'bootstrap/dist/css/bootstrap.min.css';

const nav = (props) => {
    return (
    <div className="Nav">
<Navbar>
  <Navbar.Brand href="#home">StephenTracker</Navbar.Brand>
  <Navbar.Toggle />
  <Navbar.Collapse className="justify-content-end">
//    <Navbar.Text>
//      Signed in as: <a href="#login">sdfsfsf</a>
//    </Navbar.Text>
  </Navbar.Collapse>
</Navbar>
    </div>
)};

export default nav;
